            $json['splitSettlementEnabled']       =
                VasEfeOffersSplitSettlementEnabledEnum::checkValue(
                    $this->splitSettlementEnabled
                );
        }

        return (!$asArrayWhenEmpty && empty($json)) ? new stdClass() : $json;
    }
}
